BOOL _localWiFiAvailable(void);

static NSString *cachedGID;

NSString *PHGID()
{
    // Cache the value as a static variable to prevent
    if (cachedGID == nil) {
        // Get the value from NSUserDefaults
        NSString *defaultsGID = [[NSUserDefaults standardUserDefaults] valueForKey:@"PlayHavenGID"];

        // If missing, generate a new value and store in NSUserDefaults
        if (defaultsGID == nil) {
            defaultsGID = [PHStringUtil uuid];
            [[NSUserDefaults standardUserDefaults] setValue:defaultsGID forKey:@"PlayHavenGID"];
            [[NSUserDefaults standardUserDefaults] synchronize];
        }

        cachedGID = [[NSString alloc] initWithString:defaultsGID];
    }

    return cachedGID;
}

void PHClearGID()
{
    [[NSUserDefaults standardUserDefaults] setValue:nil forKey:@"PlayHavenGID"];
    [cachedGID release], cachedGID = nil;
}

NSError *PHCreateError(PHErrorType errorType)
{
    static NSArray *errorArray = nil;
    if (errorArray == nil) {
        errorArray = [[NSArray alloc] initWithObjects:
                          @"PlayHaven received an error response from the API. Please check your token and secret values and try again.",
                          @"Response was successful, but did not contain a response object.",
                          @"The content you requested was not able to be shown because it is missing required orientation data.",
                          @"The content you requested has been dismissed because PlayHaven was not able to load content data.",
                          @"PlayHaven was not able to create the content unit overlay",
                          @"This error is for simulating an IAP error in the simulator",
                          @"Signed response did not have valid signature.", nil];
    }

    NSString *errorMessage = [errorArray objectAtIndex:errorType];
    NSDictionary *userInfo = [NSDictionary dictionaryWithObjectsAndKeys:
                                    errorMessage, NSLocalizedDescriptionKey, nil];

    return [NSError errorWithDomain:@"PlayHavenSDK" code:(NSInteger)errorType userInfo:userInfo];
}

/*
 * getWiFiIPAddress code courtesy of Matt Brown
 * http://mattbsoftware.blogspot.com/2009/04/how-to-get-ip-address-of-iphone-os-v221.html
 */
BOOL _localWiFiAvailable()
{
    struct ifaddrs *addresses;
    struct ifaddrs *cursor;
    BOOL wiFiAvailable = NO;

    if (getifaddrs(&addresses) != 0) return NO;

    cursor = addresses;
    while (cursor != NULL) {
        if (cursor -> ifa_addr -> sa_family == AF_INET
            && !(cursor -> ifa_flags & IFF_LOOPBACK)) // Ignore the loopback address
        {
            // Check for WiFi adapter
            if (strcmp(cursor -> ifa_name, "en0") == 0) {
                wiFiAvailable = YES;
                break;
            }
        }
        cursor = cursor -> ifa_next;
    }

    freeifaddrs(addresses);
    return wiFiAvailable;
}

/*
 * Network status code courtesy of unforgiven on Stack Overflow
 * http://stackoverflow.com/questions/1448411/how-to-check-for-local-wi-fi-not-just-cellular-connection-using-iphone-sdk/1480867#1480867
 */

int PHNetworkStatus()
{
    // TODO: change this to check API accessibility specifically
    struct sockaddr_in zeroAddr;
    bzero(&zeroAddr, sizeof(zeroAddr));

    zeroAddr.sin_len    = sizeof(zeroAddr);
    zeroAddr.sin_family = AF_INET;

    SCNetworkReachabilityRef target =
                SCNetworkReachabilityCreateWithAddress(NULL, (struct sockaddr *) &zeroAddr);

    SCNetworkReachabilityFlags flags;
    SCNetworkReachabilityGetFlags(target, &flags);

    CFRelease(target);

    BOOL isReachable     = ((flags & kSCNetworkFlagsReachable) != 0);
    BOOL needsConnection = ((flags & kSCNetworkFlagsConnectionRequired) != 0);

    if (isReachable && !needsConnection) // Connection is available
    {
        // Determine what type of connection is available
        BOOL isCellularConnection = ((flags & kSCNetworkReachabilityFlagsIsWWAN) != 0);

        if (isCellularConnection)
            return 1; // Cellular connection available

        if (_localWiFiAvailable())
            return 2; // Wifi connection available
    }

    return 0; // No connection at all
}

NSString *PHAgnosticStringValue(id object)
{
    return (!!object) ? [NSString stringWithFormat:@"%@",object] : nil;
}

//
// Play Haven default image helper function
//
UIImage *convertByteDataToUIImage(playHavenImage *phImage)
{
    UInt32  width  = (UInt32)phImage->width;
    UInt32  height = (UInt32)phImage->height;
    UInt32  length = (UInt32)phImage->length;
    NSData *data   = [NSData dataWithBytes:phImage->data length:length];

    CGDataProviderRef provider   = CGDataProviderCreateWithCFData((CFDataRef)data);
    CGColorSpaceRef   colorSpace = CGColorSpaceCreateDeviceRGB();
    CGBitmapInfo      bitmapInfo = kCGImageAlphaPremultipliedLast;
    CGImageRef        cgImage    = CGImageCreate(width, height, 8, 32, 4 * width, colorSpace, bitmapInfo, provider, NULL, NO, kCGRenderingIntentDefault);
    CGDataProviderRelease(provider);
    CGColorSpaceRelease(colorSpace);

    UIImage *result = [UIImage imageWithCGImage:cgImage];
    CGImageRelease(cgImage);
    return result;
}

